        hide() {
            this.elem.dataset.hidden = "";
        }

        show() {
            delete this.elem.dataset.hidden;
        }

        matchesColumnIdx(idx) {
            if (!this.elem.hasAttribute("data-column-idx")) {
                return false;
            }
            return Number(this.elem.dataset.columnIdx) === idx;
        }

        matchesColumnFilter({
            acceptedColumns
